import { Button } from "antd";
import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div className="nav bg-dark d-flex justify-content-between">
      <Link className="nav-link" to="/">
        <Button className="btn btn-raised bg-light">Home</Button>
      </Link>

      <p className="bg-light"> WELCOME TO THE WEBSITE</p>

      <Link className="nav-link" to="/login">
        <Button className="btn btn-raised bg-light">Login</Button>
      </Link>
      {/* <Link className="nav-link" to="/signup">
        Register
      </Link> */}
    </div>
  );
}

export default Home;
